import React from "react";
import styled from "styled-components";

const MenuBarContainer = styled.div`
  height: 100%;
  width: 240px;
  background-color: red;
`;

const MenuBar = () => {
  return <MenuBarContainer></MenuBarContainer>;
};

export default MenuBar;
